import React from 'react'
import ContactDropDown from './contactDropDwon.css'
import './topBar.css'


export default function TopBar(props)
{
    return(
        <div id="header">
            <image alt="logo" src={props.logoUrl} id="logo" />
            <h1 id="title">{props.name}</h1>
            <ContactDropDown
                social={props.social}
                email={props.email}
                />
        </div>
    )
}
